    false,nt"url": null,nt"notes": "This narrative report for Lake Bowdoin
    NWR outlines Refuge accomplishments from May through July of 1941. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, fish, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and collections and receipts.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses. N-R forms,
    photographs, and updates on the easement refuges are attached.",nt"owner_org":
